// 3 - Longest Substring Without Repeating Characters
// https://leetcode.com/problems/longest-substring-without-repeating-characters/

use crate::Solution;

impl Solution {
    pub fn length_of_longest_substring(s: String) -> i32 {
        if s.len() == 0 {
            return 0;
        }

        if s.len() == 1 {
            return 1;
        }

        let mut longest = 0;

        for (i, ch) in s.chars().enumerate() {
            let mut sub = "".to_string();

            for j in i..s.len() {
                let curr = s.chars().nth(j).unwrap();

                if sub.chars().position(|e| e == curr).is_some() {
                    break;
                } else {
                    sub.push(curr);
                }
            }

            if sub.len() > longest {
                longest = sub.len()
            }
        }

        longest as i32
    }
}

